descripcion:
-- rhv- --    casa en fraccionamiento jardines de san mateo.&nbsp;  
distribuci&oacute;n provechosa con espacios muy bien logrados.&nbsp;equipada con adecuaciones de sonido, iluminaci&oacute;n controlada y domo el&eacute;ctrico.&nbsp;  
el condominio cuenta con calles adoquinadas y &aacute;reas comunes bien mantenidas.&nbsp;  
f&aacute;cil acceso por av l&oacute;pez mateos y av san miguel.&nbsp;cerca de plaza jard&iacute;nes, superama san mateo y a un paso de escuelas como el colegio sierra nevada.&nbsp;  
&iexcl;no deje de conocerla!

--  --    hermoso desarrollo residencial con 6 departamentos , cada departamento con 2 lugares de estacionamiento ,&nbsp;  
departamenro 3 con 2 estacionamientos cubiertos en el segundo piso, departamento 4 segundo piso con 2 estacionamientos descubiertos, departamentos 5 y 6 cuarto piso c/u con 2 est. descubiertos.  
el desarrollo cuenta con sal&oacute;n de fiestas

vendo preciosa casa en bosques de aragon, nezahualcoyotl, edo. de mexico; 

características: sup. total 160 mt.2, area construida 310 mt.2 aprox.; amplia distribución en dos plantas; 

planta baja: sala, comedor, cocina integral equipada con ante-comedor, cuarto de t.v., 1 baño completo, cuarto de servicio área para lavado y tendido, patio trasero con cuarto de triques, estacionamiento para dos o tres autos, jardín en la parte de frente, puerta eléctrica, buenos acabados. 

planta alta: 3 recamaras (con closet cada una), cuarto de estudio, 1 baño completo con opción a dos, balcones frontales con hermosa vista al parque. 

dispone de todos los servicios (cisterna), se ubica en bonita calle cerrada, con portón de acceso, frente al segundo parque mas grande de bosques de aragon, cercana a centros comerciales y amplias avenidas, buen servicio de transportes (cercana al metro). 

el domicilio exacto es: calle bosques de guinea #55 bis, col. bosques de aragon, mpio. nezahualcoyotl, edo. de méxico, c.p. 57170.

-- rcv --    bonita casa en fraccionamiento de dos niveles, cuenta con 3 recamaras, ba&ntilde;o y medio, cocina integral, con opcion a construir una cuarta recamara, 1 lugar de estacionamiento y un peque&ntilde;o jardin privado a la entrada.  
se encuentra a media hora del restaurante los girasoles .  
casa con metros &nbsp;cuadrados de terreno 83 y metros cuadrados de construccion 100&nbsp;
